        "Kagawa",
        "Ehime",
        "Kochi",
        "Fukuoka",
        "Saga",
        "Nagasaki",
        "Kumamoto",
        "Oita",
        "Miyazaki",
        "Kagoshima",
        "Okinawa"
      ]
    }
  },
  name: 'MapJapan',
  methods: {
    trackClick(act, label){
      this.$ga.event({
        eventCategory: 'Explore Maps',
        eventAction: 'Click '+act,
        eventLabel: label
      })
    },
    togglR(itemId){
      this.trackClick('reveal Region '+itemId,itemId)
      const tgt = document.getElementById('legend-'+itemId)
      if(tgt){
        document.getElementsByClassName('legend-pane')[0].removeAttribute('style')
        if(tgt.offsetParent)
          setTimeout(() => {
            if(tgt.offsetParent.offsetTop < window.pageYOffset){
              document.getElementsByClassName('legend-pane')[0].style.paddingTop = (window.pageYOffset - tgt.offsetParent.offsetTop)+'px'
            }
          }, 400);
        tgt.click()
      }
    },
    mapEnterRegion (itemId) {
      if(this.activeSvg!=itemId)
      {
        this.activeSvg=itemId
        this.togglR(itemId)
      }
    },
    mapLeaveRegion(itemId){
      this.activeSvg=false
      this.togglR(itemId)
    },
    go2detail(prefectureId, ev){
      this.trackClick('Tooltip '+prefectureId,prefectureId)
      if (ev) {
        ev.preventDefault()
      }
      const tagName = ev.target.tagName
      if(tagName){
        this.unlockClick = ['text', 'rect'].includes(tagName)
        setTimeout(() => this.unlockClick = true, 100);
        if(window.innerWidth > 750 || ['text', 'rect'].includes(tagName) && this.unlockClick )
          this.$router.push({ path: this.pageURL(prefectureId) })
      }
    },
    pageURL(prefectureId){
      return '/explore-japan/'+this.prefectures[parseInt(prefectureId)-1].toLowerCase();
    }
  }
}
</script>
